INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (29, '{"name": "Important Scientists", "category": "Geography", "imageName": "games/game_29.jpg", "type": "GEOFINDER", "questions": [{"question": "Where was Stephen Hawking from?", "information": "Stephen William Hawking was an English theoretical physicist and mathematician. He was born in Oxford. In 1950, he moved to St Albans, Hertfordshire. He was one of the world''s leading theoretical physicists. Hawking has written many science books for people who are not scientists.", "area": 45.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Oxford", "visited_place": "Oxford", "longitude": -1.257857, "latitude": 51.752026, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 3784.6987830302405, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where was Albert Einstein from?", "information": "Albert Einstein was a German-born scientist. He worked on theoretical physics. He developed the theory of relativity.", "area": 118.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Ulm", "visited_place": "Ulm", "longitude": 9.941064, "latitude": 48.384526, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 6128.667601500942, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where was Isaac Newton from?", "information": "Sir Isaac Newton was an English mathematician, physicist, astronomer, theologian, and author (described in his own day as a \"natural philosopher\") who is widely recognised as one of the most influential scientists of all time, and a key figure in the scientific revolution.", "area": 10.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Woolsthorpe Manor", "visited_place": "Woolsthorpe Manor", "longitude": -0.630073, "latitude": 52.809562, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1784.1241161527712, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where was Marie Curie from?", "information": "Marie Salomea Sklodowska\u2013Curie was a Polish and French physicist, chemist and feminist. She did research on radioactivity. She was also the first woman to win a Nobel Prize. She was the first woman professor at the University of Paris. She was the first person to win two Nobel Prizes", "area": 517.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Warsovia", "visited_place": "Warsovia", "longitude": 21.085887, "latitude": 52.228428, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 12828.336258339184, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where was Galileo Galilei from?", "information": "Galileo Galileiwas an Italian astronomer, physicist and engineer, sometimes described as a polymath. Galileo has been called the \"father of observational astronomy\", the \"father of modern physics\", the \"father of the scientific method\", and the \"father of modern science\".", "area": 185.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Pisa", "visited_place": "Pisa", "longitude": 10.414962, "latitude": 43.715505, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7673.807981960539, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where was Charles Darwin from?", "information": "Charles Robert Darwinwas an English naturalist, geologist and biologist, best known for his contributions to the science of evolution.", "area": 20.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "The Mount", "visited_place": "The Mount", "longitude": -2.773744, "latitude": 52.713903, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 2523.13252202016, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where was Nicola Tesla from?", "information": "Nikola Tesla was a Serbian-American inventor, electrical engineer, mechanical engineer, and futurist who is best known for his contributions to the design of the modern alternating current (AC) electricity supply system.", "area": 124.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Smiljan", "visited_place": "Smiljan", "longitude": 15.309657, "latitude": 44.558392, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 6282.549314314218, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where was Thomas Alva Edison from?", "information": "Thomas Alva Edison was an American inventor and businessman, who has been described as America''s greatest inventor. He developed many devices in fields such as electric power generation, mass communication, sound recording, and motion pictures.", "area": 30.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Milan (Ohio)", "visited_place": "Milan (Ohio)", "longitude": -82.601569, "latitude": 41.289676, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 3090.1936161855165, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where was Johannes Kepler from?", "information": "Johannes Kepler was a German astronomer, mathematician, and astrologer. He is a key figure in the 17th-century scientific revolution, best known for his laws of planetary motion.", "area": 80.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Ratisbona", "visited_place": "Ratisbona", "longitude": 12.096588, "latitude": 49.004322, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 5046.26504404032, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
