a", "information": "Pedraforca is a mountain in the Pre-Pyrenees, located in the comarca of Bergued\u00e0. The mountain''s rare form, along with the fact that it is not visibly connected to any other adjacent mountains or ridges, has made it one of the most famous and emblematic mountains in Catalonia.", "area": 40.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Pedraforca", "visited_place": "Pedraforca", "longitude": 1.706561, "latitude": 42.238761, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 3568.2482323055424, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is Sierra Nevada", "information": "Sierra Nevada is a mountain range in the region of Andalucia, in the province of Granada and, a little further, M\u00e1laga and Almer\u00eda in Spain.", "area": 120.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Sierrra Nevada", "visited_place": "Sierrra Nevada", "longitude": -3.240617, "latitude": 37.06411, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 6180.387232371033, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is Monte Perdido", "information": "Monte Perdido is the third highest mountain in the Pyrenees.", "area": 156.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": 